import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Home.css';
import { Carousel } from 'react-bootstrap'; // Import Carousel component from react-bootstrap
import ExampleCarouselImage from './ExampleCarouselImage'; // Import your custom Carousel image component

const Home = () => {
  const [user, setUser] = useState(null);
  const userId = useLocation().pathname.split('/')[2];
  const [activeButton, setActiveButton] = useState('homecontent');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchUser = async () => {
      try {
        const user = await axios.post('http://localhost:4000/getUser', {
          userId: userId,
        });
        setUser(user.data.detail);
      } catch (err) {
        console.log(err);
      }
    };
    fetchUser();
  }, [userId]);

  const handleButtonClick = (buttonName) => {
    setActiveButton(buttonName);
    if (buttonName === 'logout') {
      navigate('/login');
    }
  };

  return (
    <div className="app-container">
      <Carousel>
        <Carousel.Item>
          <ExampleCarouselImage text="First slide" />
          <Carousel.Caption>
            <h3>First slide label</h3>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <ExampleCarouselImage text="Second slide" />
          <Carousel.Caption>
            <h3>Second slide label</h3>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <ExampleCarouselImage text="Third slide" />
          <Carousel.Caption>
            <h3>Third slide label</h3>
            <p>
              Praesent commodo cursus magna, vel scelerisque nisl consectetur.
            </p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    </div>
  );
};

export default Home;
